transforms.result:
* {
   margin: 0;
   padding: 0;
   text-decoration: none;
   list-style: none;
   
}

.navBar {
   font-family: mplusbold;
   position: fixed;
   z-index: 100;
   top: 0;
   display: flex;
   align-items: center;
   justify-content: space-between;
   width: 100vw;
   box-sizing: border-box;
   background-color: rgb(39, 38, 38);

}
.navBar a {
   color: white;
}

.logo-img {
   background-image: url('/img/logo-byno.png');
   height: 5rem;
   width: 5rem;
   background-size: contain;
   background-repeat: no-repeat;
   margin-left: 1.5rem;
}

.liste-onglets {
   display: flex;
}

.liste-onglets .router-link-exact-active {
 color: #009FE3;
 border-bottom: 1px solid #009FE3;
}

.liste-onglets img {
   display: none;
}

.liste-onglets a {
   margin: 0 1rem;
   font-size: 0.6rem;
   transition: all 0.2s ease-in-out;
}

.liste-onglets a:hover {
    color: #009FE3;
}

.liste-onglets a.active {
   color: #009FE3;
   font-size: 0.8rem;
} 

.liste-socials {
    padding-right: 1.5rem;
}

.liste-socials img {
 margin-right: 0.5rem;
 height: 2rem;
}

.menu-burger {
   display: none;
   height: 2.5rem;
   width: 2.5rem;
   position: absolute;
   right: 12vw;
   animation: fadeInAnimation ease 0.4s;
   animation-iteration-count: 1;
   animation-fill-mode: forwards;
}

.cross {
   height: 3rem;
   width: 3rem;
   animation: fadeInAnimation ease 0.4s;
   animation-iteration-count: 1;
   animation-fill-mode: forwards;
}

@keyframes fadeInAnimation {
   0% {
       opacity: 0;
   }

   100% {
       opacity: 1;
   }
}


/* version mobile */
@media screen and (max-width: 800px) {
   .navBar {
       padding: 0;
   }
   .menu-burger{
       display: block;
   }
   
   .liste-socials {
       display: none;
   }
   .liste-onglets img {
       width: 45vw;
       margin-bottom: 3rem;
       display: block;
   }
   .liste-onglets {
       top: 0;
       left: 0;
       position: absolute;
       display: flex;
       justify-content: center;
       align-items: center;
       flex-direction: column;
       background-color: rgba(255, 255, 255, 0.281);
       backdrop-filter: blur(7px);
       width: 100%;
       height: 100vh;
       margin-left: -100% ;
       transition: all 0.4s ease;

   }
   .active2 {
       margin-left: 0;
   }
   .liste-onglets a {
       margin: 0.6rem 1rem;
       font-size: 1.1rem;
   }
}
